	static int[][] map;
	static int ans;
	static boolean flag;
	static void check(int y,int N) {
		flag=false;
		for(int i=0;i<N;i++) {
			int tmp=map[i][y];
			if(tmp==1) {
				flag=true;
			}
			if(tmp==2&&flag) {
				ans++;
				flag=false;
			}
		}
	}
